    [],nt"revision_timestamp": "2016-08-02T20:54:33.351140",nt"name": "distributed-structure-searchable-toxicity-eb5b7",nt"isopen":
    true,nt"url": null,nt"notes": "The Distributed Structure Searchable Toxicity
    (DSSTox) online resource provides high quality chemical structures and annotations
    in association with toxicity data. It helps to build a data foundation for improved
    structure-activity relationships and predictive toxicology. DSSTox publishes summarized
    chemical activity representations for structure-activity modeling and provides a
    structure browser. This tool also houses the chemical inventories for the ToxCast
    and Tox21 projects.",nt"license_title": "Other License Specified",nt"extras":
